/** 
 * Ready to receive the request or not.
 * @return HTTP code equal to 200 indicates that Nacos is ready. HTTP code equal to 500 indicates that Nacos is notready.
 */
@GetMapping("/readiness") public ResponseEntity readiness(HttpServletRequest request){
  boolean isConfigReadiness=isConfigReadiness();
  boolean isNamingReadiness=isNamingReadiness(request);
  if (isConfigReadiness && isNamingReadiness) {
    return ResponseEntity.ok().body("OK");
  }
